class DashboardGraphComponent {
    constructor(leaveRequestService, interactionService, modalService) {
        this.leaveRequestService = leaveRequestService;
        this.interactionService = interactionService;
        this.modalService = modalService;
        this.view = [650, 300];
        // options
        this.showXAxis = true;
        this.showYAxis = true;
        this.gradient = true;
        this.showLegend = true;
        this.showXAxisLabel = true;
        this.xAxisLabel = 'Month';
        this.xAxisLabelBar = 'Leave Type';
        this.showYAxisLabel = true;
        this.yAxisLabel = 'Leave Request';
        this.legendTitle = 'Leave Type';
        this.legendTitle1 = 'Month';
        this.colorScheme = {
            domain: [this.getRandomColor(), this.getRandomColor(), this.getRandomColor()]
        };
    }
    getRandomColor() {
        var color = Math.floor(0x1000000 * Math.random()).toString(16);
        return '#' + ('000000' + color).slice(-6);
    }
    onSelect(data) {
        this.leaveRequestService.getGraphSummary(data).subscribe(resp => {
            this.modelRef = this.modalService.openGraphSummaryPopUp(resp, 'Leave Summary', (obj) => { this.okClickEvent(obj); }, "OK");
            console.log('Item clicked', JSON.parse(JSON.stringify(data)));
        });
    }
    okClickEvent(obj) {
        this.modelRef.hide();
    }
    onActivate(data) {
        console.log('Activate', JSON.parse(JSON.stringify(data)));
    }
    onDeactivate(data) {
        console.log('Deactivate', JSON.parse(JSON.stringify(data)));
    }
    getGraphData() {
        this.leaveRequestService.getDashBoardGraphRequests().subscribe(resp => {
            this.multi = resp.dashBoardGraphDto;
        });
    }
    ngOnInit() {
        this.getGraphData();
        this.interactionService.grapph$.subscribe(resp => {
            this.getGraphData();
        });
    }
}
